// 3. Determine unique URL visits per session. To clarify, count a hit to a unique URL only once per session.
val url_count_data = sessionized_data.groupBy($"session_id").agg(countDistinct($"url") as "unique_url_count")
// url_count_data.write.parquet(output_path+"URL_count_per_session.parquet")
url_count_data.show(8, false)

// 4. Find the most engaged users, ie the IPs with the longest session times
val ip_data = session_length_data.groupBy($"client_ip").agg(mean($"session_length") as "average_session_length", count($"*") as "number_of_sessions").sort(desc("average_session_length"))
val n = 100
val top_n_users = ip_data.limit(100)
// top_n_users.write.parquet(output_path+"Top_n_users.parquet")
top_n_users.show(8, false)

// 3. Predict the number of unique URL visits by a given IP
// Index features
val assembler = new VectorAssembler()
  .setInputCols(Array("Prev_sent_bytes", "Prev_received_bytes", "Prev_response_processing_time", "Prev_session_length", "Prev_unique_url_count", "Prev_Mobile", "Prev_Web"))
  .setOutputCol("assembledFeatures")

// Build Data
val buildData_url = assembler
    .transform(build_data_session)
    .select(
        "assembledFeatures",
        "unique_url_count"
    )

// Validation Data
